ily!\" and suggestion \"Could use more time per session.\" for program \"Muscle Mastery\"\r\n    Then Tell the client that they need to complete the program first\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client entered a non-numerical value for rating\r\n    When Client \"eyas\" gave a rating \"good!\" and review \"Very good! make me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Weight Loss Advanced\"\r\n    Then Tell the client that the rating should be a numerical value\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client entered a value for rating outside the acceptable range\r\n    When Client \"eyas\" gave a rating \"-52\" and review \"VERY VERY BAD! MADE ME GAIN WEIGHT!\" and suggestion \"DO NOT FALL FOR THIS SCAM\" for program \"Weight Loss Advanced\"\r\n    Then Tell the client that the rating should be within the acceptable range\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client gave a bad rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"1\" and review \"it's bad! didn't lose weight at all!\" and suggestion \"Time per session is too little! More session time can save the program.\" for program \"Weight Loss Advanced\"\r\n    Then Apologize to the client and assure them that their suggestion will be considered\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client gave an okay rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"5\" and review \"it's okay! didn't lose much weight though!\" and suggestion \"Needs more times per session!\" for program \"Weight Loss Advanced\"\r\n    Then Thank the client for the their review and say that you'll try to fix the problem\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client gave a good rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\"       |\r\n      | 0          | 62       | 2        |  invalid type                                      |\r\n      | -1         | 40       | 1        |  invalid type                                      |\r\n      | fff        | 40       | 1        |  invalid type                                      |\r\n      | 1          | -10      | 4        |  invalid data must be a positive number            |\r\n      | 2          | -20      | 5        |  invalid data must be a positive number            |\r\n      | 1          | bb       | 4        |  invalid data must be a positive number            |\r\n      | 3          | -20      | 1        |  invalid data must be between 0 and 100            |\r\n      | 3          | 150      | 5        |  invalid data must be between 0 and 100            |\r\n      | 3          | vv       | 5        |  invalid data must be between 0 and 100            |\r\n      | vv         | -40      | 1        |  invalid type                                      |\r\n\r\n  Scenario: return file;\r\n    Then returnfiles;","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/Eyas\/IdeaProjects\/EyasAdamProject\/src\/Features\/InstructorFeatures\/Edit-The-Progress-Of-A-Client.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Edit the progress of a client","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario Outline","name":"Edit progress data of a client successfully","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"the type of the edited value is \"<toEditType>\"","id":"b10d2db5-d90c-4e31-8fb5-0c0fa6d1436c"},{"location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the new value is \"<NewValue>\"","id":"45c452f1-5408-4c9c-bfb8-9453025f60ec"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Act     | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | no notification |\r\n      | 6      | no notification |\r\n      | 7      | no notification |\r\n      | 8      | no notification |\r\n      | 9      | no notification |\r\n      | 10     | no notification |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program2\" about an update\r\n  Scenario Outline: Notify clients about updates to program2\r\n    Given I have an \"update\" in program \"program2\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | no notification |\r\n      | 9      | no notification |\r\n      | 10     | no notification |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program3\" about a removal\r\n  Scenario Outline: Notify clients about removals from program3\r\n    Given I have an \"remove\" in program \"program3\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | remove          |\r\n      | 9      | remove          |\r\n      | 10     | remove          |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program1\" about a removal\r\n  Scenario Outline: Notify clients about removals from program1\r\n    Given I have an \"remove\" in program \"program1\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | remove          |\r\n      | 2      | remove          |\r\n      | 3      | remove          |\r\n      | 4      | remove          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | remove          |\r\n      | 9      | remove          |\r\n      | 10     | remove          |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  Scenario: notify a program with no enrolled clients\r\n    Given I have an \"update\" in program \"program4\"\r\n    And no clients are enrolled in this program\r\n    When I notify the clients enrolled in this program\r\n    Then the system shows \"No clients are enrolled in this program\"\r\n\r\n  Scenario: notify a program that did not have any change\r\n    Given I have an \"update\" in program \"program1\"\r\n    When I notify the clients enrolled in this program with no change\r\n    Then the system shows \"No change to this program\"\r\n\r\n  Scenario: notify a program that does not exist\r\n    Given I have an \"programNEW\"\r\n    When I notify for program that does not exist\r\n    Then the system shows \"this program does not exist\"\r\n\r\n  Scenario: return file;\r\n    Then returnfiles;","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/Eyas\/IdeaProjects\/EyasAdamProject\/src\/Features\/InstructorFeatures\/Notify-clients.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Notify clients about changes to program","description":"  As a program manager\n  I want to notify clients about updates or removals in programs\n  So that they stay informed about relevant changes","children":[{"scenario":{"location":{"line":7,"column":3},"tags":[],"keyword":"Scenario Outline","name":"Notify clients about updates to program1","description":"","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","keywordType":"Context","text":"I have an \"update\" in program \"program1\"","id":"72b2b4bf-4085-4027-897d-981d6d67be97"},{"location":{"line":9,"column":5},"keyword":"When ","keywordType":"Action","text":"I notify the clients enrolled in this program","id":"a21713e5-3fda-46c6-ba3c-e8a97b126245"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"the client \"<client>\" should receive the notification \"<notification>\"","id":"9c42187f-b814-4d57-b608-dfe4d7bd3cb2"},{"location":{"line":11,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the system shows \"The notification has been sent\"","id":"85aad2fb-ea08-4b59-8806-afbac48752b4"}],"examples":[{"location":{"line":12,"column":5},"tags":[],"keyword":"Examples","name":"","description":"","tableHeader":{"location":{"line":13,"column":7},"cells":[{"location":{"line":13,"column":9},"value":"client"},{"location":{"line":13,"column":18},"value":"notification"}],"id":"0e3ed70b-16e4-4b8c-9900-2ed8fd1abb69"},"tableBody":[{"location":{"line":14,"column":7},"cells":[{"location":
